VI - tonelagem de rejeito produzido ano a ano;
VII - tonelagem de minério beneficiado;
VIII - tonelagem de fibras de amianto obtidas com o beneficiamento nas diversas classes de tamanho, ano a ano;
IX - tonelagem de fibras de amianto que foram objeto de
exportação ano a ano;
X - atualização de Plano de Fechamento de Mina;
XI - faturamento anual da exportação de amianto;
XII - quantidade de empregados em todas as atividades
da mina, incluindo suas profissões;
XIII - relatório específico contendo todas as CATs -
Comunicações de Acidente de Trabalho abertas acerca de eventuais
doenças típicas do amianto entre os empregados;
XIV - cumprimento de condicionantes ambientais,
notadamente recuperação de áreas degradadas.

