Art. 2º O Grupo de Trabalho será composto por representantes,
membros titulares e suplentes, a serem indicados formalmente pelos
dirigentes das instituições a seguir relacionadas:
I - Secretaria de Estado da Saúde de Goiás - SES/GO:
a) Superintendência de Vigilância em Saúde;
b) Superintendência da Escola de Saúde de Goiás;
c) Superintendência de Atenção Integral à Saúde;
II - Universidade Federal de Goiás - UFG;
III - Universidade Estadual de Goiás - UEG;
IV - Instituto Federal de Educação, Ciência e Tecnologia - Goiás;
V - Federação dos Trabalhadores da Indústria de GO-TO-DF -
FTIEG;
VI - Grupo Técnico Mineração - Projeto Brasil Popular.

I - Fomentar, participar e realizar estudos e elaborar diagnóstico
dos riscos à saúde, diretos e indiretos, relacionados à atividade
de mineração no Estado de Goiás;

II - Propor e participar de ações de promoção de saúde para
os trabalhadores e a população residente nos Municípios
impactados pela atividade mineradora;

IV - Promover a articulação com Instituições públicas e privadas
de Goiás e dos demais estados da Federação, que estejam
relacionadas ao tema da mineração;

IV - ter livre acesso às unidades desta Pasta, para que possa propor
soluções requeridas em cada situação, com exceção de assuntos
classificados como sigilosos;

VI - informar às autoridades competentes eventuais omissões ou
mesmo descumprimento de prazo estipulado para oferecimento de
respostas;

III - promover e atuar diretamente na defesa dos direitos dos usuários
de serviços públicos, nos termos da Lei federal nº 13.460, de 26 de
junho de 2017;

IV- receber, analisar e responder todas as manifestações que lhes
forem encaminhadas (reclamações, denúncias, sugestões, elogios,
pedidos de informação ou comunicação);

V - receber, analisar e encaminhar os pedidos de acesso à
informação de que trata a http://www.gabinetecivil.go.gov.br/pagina_
leis.php?id=10836;

VI - processar informações obtidas por meio das manifestações
recebidas e das pesquisas de satisfação realizadas com a finalidade
de subsidiar as ações de governo;

II - coordenar o trabalho de entrevista ao usuário/cidadão a fim de
obter informações relevantes para encaminhamento aos Setores de
Fiscalização e Inteligência;

